import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import reportWebVitals from './reportWebVitals';

const Hello = (props) => {
  return (
    <div>
      <p> Hello {props.city}, and you are located at {props.location} of Australia! </p>
    </div>
  )
}

const App = () => {
  const city = ['Sydney', 'Melborune', 'Perth']
  const location = ['southeast', 'south', 'west']
  return (
    <div>
      <Hello city={city[0]} location={location[0]}/>
      <Hello city={city[1]} location={location[1]}/>
      <Hello city={city[2]} location={location[2]}/>
    </div>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

